using DocumentFormat.OpenXml.Packaging;

namespace CV.Management.Generation.Ppt.Helpers
{
    public static class GenerateImagePartHelper
    {
        // Placeholder image
        private const string ImagePart1Data = "";

        // Amrop logo
        private const string ImagePart2Data = "";
        
        // Amrop logo
        private const string ImagePart3Data = "";
        
        // Half of Amrop logo
        private const string ImagePart4Data = "";

        private static System.IO.Stream GetBinaryDataStream(string base64String)
        {
            return new System.IO.MemoryStream(System.Convert.FromBase64String(base64String));
        }

        public static void GenerateImagePart1Content(ImagePart imagePart1, string content)
        {
            var pictureContent = string.Empty;
            if (!string.IsNullOrEmpty(content))
            {
                pictureContent = content;
            }
            else
            {
                pictureContent = ImagePart1Data;
            }

            System.IO.Stream data = GetBinaryDataStream(pictureContent);
            imagePart1.FeedData(data);
            data.Close();
        }

        public static void GenerateImagePart2Content(ImagePart imagePart2)
        {
            System.IO.Stream data = GetBinaryDataStream(ImagePart2Data);
            imagePart2.FeedData(data);
            data.Close();
        }

        public static void GenerateImagePart3Content(ImagePart imagePart3)
        {
            System.IO.Stream data = GetBinaryDataStream(ImagePart3Data);
            imagePart3.FeedData(data);
            data.Close();
        }

        public static void GenerateImagePart4Content(ImagePart imagePart4)
        {
            System.IO.Stream data = GetBinaryDataStream(ImagePart4Data);
            imagePart4.FeedData(data);
            data.Close();
        }
    }
}
